"use strict";

import { Rain } from "./rain.js";

const canvas = document.querySelector("canvas");
const ctx = canvas.getContext("2d");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
let particleArray = [];
let rains = [];

const background = new Image();
background.src = "background.png";

//mouse
let mouse = {
    x: null,
    y: null,
    radius: 50,
};
window.addEventListener("mousemove", (event) => {
    mouse.x = event.x + canvas.clientLeft / 2;
    mouse.y = event.y + canvas.clientTop / 2;
});

function drawImage() {
    let imageWidth = png.width;
    let imageHeight = png.height;
    const data = ctx.getImageData(0, 0, imageWidth, imageHeight);
    console.log(data);
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    class Particle {
        //가운데에 두려고.. ㅋㅋㅋㅋㅋㅋ
        constructor(x, y, color, size) {
            this.x = x + canvas.width / 2 - png.width * 2;
            this.y = y + canvas.height / 2 - png.height * 2;
            this.color = color;
            this.size = 2;
            this.baseX = x + canvas.width / 2 - png.width * 2;
            this.baseY = y + canvas.height / 2 - png.height * 2;
            this.density = Math.random() * 10 + 2;
        }
        draw() {
            ctx.beginPath();
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.closePath();
            ctx.fill();
        }

        update() {
            ctx.fillStyle = this.color;

            //collision detection
            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx * dx + dy * dy);
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;

            //max distance, past that the force will be 0
            const maxDistance = 100;
            let force = (maxDistance - distance) / maxDistance;
            if (force < 0) force = 0;

            let directionX = forceDirectionX * force * this.density * 3;
            let directionY = forceDirectionY * force * this.density * 3;

            if (distance < mouse.radius + this.size) {
                this.x -= directionX;
                this.y -= directionY;
            } else {
                if (this.x !== this.baseX) {
                    let dx = this.x - this.baseX;
                    this.x -= dx / 10;
                }
                if (this.y !== this.baseY) {
                    let dy = this.y - this.baseY;
                    this.y -= dy / 10;
                }
            }
            this.draw();
        }
    }
    function init() {
        particleArray = [];
        console.log("init");
        for (let y = 0, y2 = data.height; y < y2; y++) {
            for (let x = 0, x2 = data.width; x < x2; x++) {
                if (data.data[y * 4 * data.width + x * 4 + 3] > 128) {
                    let positionX = x;
                    let positionY = y;
                    let color =
                        "rgba(" +
                        data.data[y * 4 * data.width + x * 4] +
                        "," +
                        data.data[y * 4 * data.width + x * 4 + 1] +
                        "," +
                        data.data[y * 4 * data.width + x * 4 + 2];
                    (")");
                    particleArray.push(
                        new Particle(positionX * 4, positionY * 4, color)
                    );
                }
            }
        }

        rains = (() => {
            let temp = new Array();
            for (let i = 0; i < 20; i++) {
                const rain = new Rain(
                    Math.random() * canvas.width,
                    Math.random() * canvas.height,
                    Math.random() * 3,
                    Math.random() * 5 + 5
                );
                rain.resize(canvas.width, canvas.height);
                temp.push(rain);
            }
            return temp;
        })();
    }
    function animate() {
        requestAnimationFrame(animate);

        // ctx.drawImage(background, 0, 0, canvas.width, canvas.height);

        ctx.fillStyle = "rgba(0,0,0, 0.5)";
        ctx.fillRect(0, 0, innerWidth, innerHeight);

        //rain draw
        rains.forEach((element) => {
            element.draw(ctx);
        });

        //이게 버튼 관련 스크립트
        // ctx.fillStyle = "red";
        // ctx.font = "italic bold 28px Arial, sans-serif";
        // ctx.fillText("hahaha", 400, 500);

        for (let i = 0; i < particleArray.length; i++) {
            particleArray[i].update();
        }
    }
    init();
    animate();

    window.addEventListener("resize", () => {
        canvas.width = innerWidth;
        canvas.height = innerHeight;
        init();
    });
}

const png = new Image();
png.src =
    "data:image/png;base64,";
window.addEventListener("load", () => {
    console.log("page has loaded");
    ctx.drawImage(png, 0, 0, 100, 75);
    png.width = 100;
    png.height = 75;
    drawImage();
});
